import React, { useState, useEffect, Fragment } from 'react';
import axios from 'axios';

const listOflistOflistOflistOfUSerList = () => {
    const [count, setCount] = useState(1);
    const [listOflistOflistOflistOflistOfUSer, setlistOflistOflistOflistOflistOfUSer] = useState({});
    
    
    useEffect(() => {
        axios
        .get(`https://jsonplaceholder.typicode.com/listOflistOflistOflistOfUSers/${count}`)
        .then((response) => {
            setlistOflistOflistOflistOflistOfUSer(response.data)
        })
        .catch((err) => {
            console.log(err)
        })
    }, [count]);


