                                              </div>
                                    )*/
    
    
    const isOverTen = () => {
        return count > 10 
    };
    

return (
   <Fragment>
       <div className="container m-3">
          <h1 className="text-center bg-dark text-white">KIMO APP</h1>
            {
              isOverTen() && <div className="alert alert-danger">STOP !!!</div>
            }
              <button className="btn btn-info mt-5 mb-2"onClick={() => setCount(count + 1)}>listOflistOflistOflistOfUSer {count}</button>
             <ul className="list-group">
               <li className="list-group-item"><strong>name:</strong> {listOflistOflistOflistOfUSer.name}</li>
               <li className="list-group-item"><strong>listOflistOflistOflistOfUSername:</strong> {listOflistOflistOflistOfUSer.listOflistOflistOflistOfUSername}</li>
               <li className="list-group-item"><strong>email:</strong> {listOflistOflistOflistOfUSer.email}</li>
               <li className="list-group-item"><strong>website:</strong> {listOflistOflistOflistOfUSer.website}</li>
             </ul>
       </div>
   </Fragment>
  )
}

export default listOflistOflistOflistOfUSerList;
